import "./App.css";

import Navbar from "./components/Navbar.js";
import Footer from "./components/Footer.js";

import MainPage from "./page/MainPage.js";
import LoginPage from "./page/LoginPage.js";
import SignUpPage from "./page/SignUpPage.js";

import DailySignPage from "./page/DailySignPage";
import HospitalSignPage from "./page/HospitalSignPage";
import SchoolSignPage from "./page/SchoolSignPage";
import DownloadPage from "./page/DownloadPage";
import NoticePage from "./page/NoticePage";

import Service from "./page/Service.js";

import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<MainPage />}></Route>

          <Route path="/LoginPage" element={<LoginPage />}></Route>
          <Route path="/SignUpPage" element={<SignUpPage />}></Route>

          <Route path="/Service" element={<Service />}></Route>
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
